];
const BomDC = ({ open }) => (
    <Modal isOpen={open}>
        <ModalHeader>
            <div><h3>Bom DC</h3></div>
        </ModalHeader>
        <ModalBody>
            <FormGroup>
                <label>Wire clips for PV wire- Heyco S6405</label>
                <View style={styles.row}>
                    <View style={styles.inputWrap}>
                        <Text style={styles.label}>Expiration date</Text>
                        <TextInput style={styles.inputdate} />
                    </View>

                    <View style={styles.inputWrap}>
